import * as action from "./actionsType";

export function vote() {
  return {
    type: action.UPVOTE,
  };
}

export function downvote() {
  return {
    type: action.DOWNVOTE,
  };
}

export function memsFetched(mems) {
  return { type: action.FETCH_MEMS_SUCCESS, mems };
}
